$numSheets = count($this->workSheetCollection);

if ($worksheetIndex > $numSheets - 1) {
    throw new Exception(
        "You tried to set a sheet active by the out of bounds index: {$worksheetIndex}. The actual number of sheets is {$numSheets}."
    );
